import {Link, Route} from 'react-router-dom';
import Home from './pages/Home';

function App() {
  return (
    <div>
      <h1>Index Page</h1>
      <div>
        <ul>
          <li to="/">Index</li>
          <li to="/home">Home</li>
        </ul>
      </div>
      <div className="App-intro">
        <Route path="/" component={App}/>
        <Route path="/home" component={Home}/>
      </div>
    </div>
  );
}

export default App;
